import { useLocation } from "react-router-dom";
import * as S from '../styles/Exercise/Exercise.style'
import 'fullpage.js';
import 'fullpage.js/vendors/scrolloverflow';
import 'fullpage.js/dist/jquery.fullpage.min.css';
import $ from 'jquery';

function Exercise() {
  $(() => {
    $('#fullpage').fullpage({
      scrollOverflow: true,
    });
  });

  const location = useLocation()
  const { routine } = location.state
  console.log(routine)
  const name = routine[routine.length - 1].name;

  return (
    <S.Container id="fullpage">
      <S.Exercise className="section">{name}</S.Exercise>
      <S.Exercise className="section">두번째</S.Exercise>
    </S.Container>
  )
};

export default Exercise;
